export default {
  "LOCAL_STORAGE_NOT_SUPPORTED": {
    message: "LocalStorage seems is not supported."
  },
  "PLAYER_NOT_FOUND_IN_LOCAL_STORAGE": {
    message: "Player has not been found in localstorage."
  },
  "GENERIC_ERROR_WHILE_RETRIVING_PLAYER_FROM_LOCAL_STORAGE": {
    message: "Something went wrong when attempting to get player from localstorage."
  }
}
